import {mainBtn} from "../../../../mainTemp";
import {componentsOfLang, frameWorks} from "../../../../models";
import {array} from "./array";
import {javaScript} from "../../javascript";
import {pureJS} from "../pureJS";

export function classes(){
    const classes = `<div class="content">
                <div class="row">
                    <div class="col-sm">
                        <a href="https://developer.mozilla.org/ru/docs/Web/JavaScript/Reference/Global_Objects/Array" target="_blank">
                            <h3 class="title">Классы</h3>
                        </a>
                    </div>
                </div>
            </div>`

    const appTemp = document.querySelector('#app')
    appTemp.insertAdjacentHTML('beforeend', classes)

    const compBtn = document.querySelectorAll('.btn')
    compBtn.forEach(comp=> {
        comp.addEventListener('click', () => {
            console.log(comp)
            const arr = [
                {name:'Типы данных',get value(){mainBtn(componentsOfLang('JavaScript', 'PureJS').parts.value); array()}},
                {name:'Операторы',get value(){mainBtn(componentsOfLang('JavaScript', 'PureJS').parts.value); classes()}},
                {name:'Циклы',get value(){ mainBtn(componentsOfLang('JavaScript', 'PureJS').parts.value); array()}},
                {name:'Функции',get value(){mainBtn(componentsOfLang('JavaScript', 'PureJS').parts.value); classes()}},
                {name:'Массивы',get value(){mainBtn(componentsOfLang('JavaScript', 'PureJS').parts.value); array()}},
                {name:'Обьекты',get value(){mainBtn(componentsOfLang('JavaScript', 'PureJS').parts.value); array()}},
                {name:'Классы',get value(){mainBtn(componentsOfLang('JavaScript', 'PureJS').parts.value); classes()}},
                {name:'Back',get value(){mainBtn(frameWorks('JavaScript').frameWorks.value); javaScript()}},
            ]
            arr.forEach(item=>{
                if(item.name === comp.innerHTML){
                    appTemp.innerHTML = ''
                    item.value
                }
            })
        })
    })
}
